Entries.RequestBody:
{
  "properties": {
    "description": "The pipeline topology with video source, encoder processor and video sink.",
    "parameters": [
      {
        "name": "videoNameParameter",
        "type": "String",
        "description": "video name"
      },
      {
        "name": "videoSourceTimeSequenceParameter",
        "type": "String",
        "description": "video source time sequence parameter"
      },
      {
        "name": "videoSourceVideoNameParameter",
        "type": "String",
        "description": "video source video name parameter"
      }
    ],
    "sources": [
      {
        "@type": "#Microsoft.VideoAnalyzer.VideoSource",
        "videoName": "${videoSourceVideoNameParameter}",
        "timeSequences": {
          "@type": "#Microsoft.VideoAnalyzer.VideoSequenceAbsoluteTimeMarkers",
          "ranges": "${videoSourceTimeSequenceParameter}"
        },
        "name": "videoSource"
      }
    ],
    "processors": [
      {
        "@type": "#Microsoft.VideoAnalyzer.EncoderProcessor",
        "preset": {
          "@type": "#Microsoft.VideoAnalyzer.EncoderSystemPreset",
          "name": "SingleLayer_1080p_H264_AAC"
        },
        "inputs": [
          {
            "nodeName": "videoSource"
          }
        ],
        "name": "encoderProcessor"
      }
    ],
    "sinks": [
      {
        "@type": "#Microsoft.VideoAnalyzer.VideoSink",
        "videoName": "${videoNameParameter}",
        "videoCreationProperties": {
          "title": "ParkingLot(Camera1)",
          "description": "Parking lot south entrance"
        },
        "inputs": [
          {
            "nodeName": "encoderProcessor"
          }
        ],
        "name": "videoSink"
      }
    ]
  },
  "kind": "Batch",
  "sku": {
    "name": "Batch_S1"
  }
}

